import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import LoginPage from "./components/LoginPage";
import RegistrationPage from "./components/RegistrationPage";
import GalleryPage from "./components/GalleryPage";
import AddPaintingPage from "./components/AddPaintingPage.js";
import UpdateUserPage from "./components/UpdateUserPage.js";
import PrivateRoute from "./components/PrivateRoute"; // Import the PrivateRoute component

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public Route */}
        <Route path="/" element={<LoginPage />} />

        {/* Public Route */}
        <Route path="/register" element={<RegistrationPage />} />

        {/* Protected Routes (using PrivateRoute) */}
        <PrivateRoute path="/update-user" element={<UpdateUserPage />} />
        <PrivateRoute path="/gallery" element={<GalleryPage />} />
        <PrivateRoute path="/add-painting" element={<AddPaintingPage />} />
      </Routes>
    </Router>
  );
};

export default App;
